import React from 'react';
import { Link } from "react-router-dom";
import logoImg from '../assets/images/logo.png';
const Footer = () => {
  return (
    <div className='relative mt-6 bottom-0 bg-sky-400 w-full'>

      <div className="flex w-screen">
        {/* First Column - 10% */}

        <div className="w-4/12 bg-gray-700 ">
          <p>This is Image</p>
          <div>
            <Link to="/"> <div className=" w-14 h-14 text-end mx-5 mt-2">
              <img className="rounded-full" src={logoImg} alt="Logo" />
            </div>
            </Link>
          </div>
        </div>
        <div className="w-4/12  inline-grid ">


        </div>
        <div className="w-4/12 bg-gray-700 ">


        </div>
      </div>
    </div>

  )
}
export default Footer;
